import React from 'react';
import Layout from '../components/Layout/Layout';
import CountryList from "../components/CountryList/CountryList";
import {countryProps, UserContextProvider } from '../components/Countries/CountryInterface';

const theData:countryProps = {
    id: 1,
    name: "Aruba",
    currency: "florin",
    weather: "28degrees"
};

const Components: React.FC = () => {
    return (
        <Layout page="Components">
            <UserContextProvider value={theData}>
                <CountryList/>
            </UserContextProvider>
        </Layout>
    )
};

export default Components;
